import { useState } from 'react';
import { Link } from "react-router-dom";
import "./register.scss";
import axios from "axios";


const Register = () => {

  const [inputs, setInputs] = useState({
    username: '',
    password: '',
    email: '',
    nummatricula: '',
    name: '',
    cpf: '',
  })

  const [err, setErr] = useState(null);

  const handleChange = (e) =>{
    const { name, value } = e.target;
    if ((name === 'nummatricula' || name === 'cpf') && !/^\d+$/.test(value)) {
      return; // Retorna se não for um número
    }
    setInputs((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleClick = async (e) =>{
    e.preventDefault()

    try{
        await axios.post("http://localhost:8800/api/auth/register", inputs);
    } catch(err){
      setErr(err.response.data);
    }

  };

  return (
    <div className="register">
      <div className="card">
        <div className="right">
          <h1 className='center'>Registre-se:</h1>
          <form>
          <input
        type="text"
        placeholder="Nome de usuario"
        name="username"
        onChange={handleChange}
        value={inputs.username}
      />
      <input
        type="password"
        placeholder="Senha"
        name="password"
        onChange={handleChange}
        value={inputs.password}
      />
      <input
        type="email"
        placeholder="Email da instituição"
        name="email"
        onChange={handleChange}
        value={inputs.email}
      />
      <input
        type="text"
        placeholder="Instituição"
        name="instituicao"
        onChange={handleChange}
        value={inputs.email}
      />
      <input
        type="text"
        placeholder="Curso"
        name="curso"
        onChange={handleChange}
        value={inputs.nummatricula}
      />
      <input
        type="text"
        placeholder="semestre"
        name="semestre"
        onChange={handleChange}
        value={inputs.nummatricula}
      />
      <input
        type="text"
        placeholder="Numero de Matricula"
        name="nummatricula"
        onChange={handleChange}
        value={inputs.nummatricula}
      />
      <input
        type="text"
        placeholder="Nome de exibição"
        name="name"
        onChange={handleChange}
        value={inputs.name}
      />
      <input
        type="text"
        placeholder="CPF"
        name="cpf"
        onChange={handleChange}
        value={inputs.cpf}
      />
            
            
       {err && err}

            </form>
            <button className='center' onClick={handleClick}>Registrar</button>
            <p className='toLogin'>
               <Link to="/login" style={{color: '#666'}}>Já tem uma conta?</Link>
            </p>
        </div>
      </div>
    </div>
  );
};
export default Register;
